  // Attendre le logo pour l'ajouter

function DashboardPage() {
 
  const pios = [{ prenom: "Adèle", nom: "Brasseur", totem: "Dama", timing: "0" }, { prenom: "Alexandre", nom: "Thirion", totem: "Alaskan", timing: "1" },
  { prenom: "Aline", nom: "Laurent", totem: "Iomys", timing: "7" }, { prenom: "Amélie", nom: "Vandewijer", totem: "Tanuki", timing: "1" },
  { prenom: "Anoée", nom: "Beaufils", totem: "Herminéa", timing: "8" }, { prenom: "Brice", nom: "Tytgat", totem: "Axis", timing: "11" },
  { prenom: "Céline", nom: "Michels", totem: "Colféo", timing: "6" }, { prenom: "Charles", nom: "Montagne", totem: "Nagor", timing: "1" },
  { prenom: "Charlotte", nom: "Binamé", totem: "Sanderling", timing: "1" }, { prenom: "Ella", nom: "Dozin", totem: "Once", timing: "7" },
  { prenom: "Elodie", nom: "Giot", totem: "Ouandji", timing: "7" }, { prenom: "Eva", nom: "Borlée", totem: "Irbis", timing: "0" },
  { prenom: "Imad", nom: "El Amiri", totem: "/", timing: "7" }, { prenom: "Louise", nom: "Buxant", totem: "Chousingha", timing: "12" },
  { prenom: "Marion", nom: "Sulin", totem: "Fennec", timing: "0" }, { prenom: "Merlin", nom: "Maus", totem: "Akita", timing: "0" },
  { prenom: "Pierrick", nom: "Delstanches", totem: "Lemming", timing: "8" }, { prenom: "Rosaline", nom: "Van Doren", totem: "Scotia", timing: "1" },
  { prenom: "Sarah", nom: "De Meester", totem: "/", timing: "0" }, { prenom: "Sylvia", nom: "Houziaux", totem: "Yerli", timing: "8" }]

  return (
    <div class="container-fluid">
      <div class="row">
        <div class="text-center col-12 mt-4 ">
          <Title>Quantité de Travail</Title>
        </div>
      </div>
      <div class="row">
        <div class="text-center col-4 offset-4">
          <p>Argent récolté : 105€</p>
        </div>
        <div class="text-center col-4">
          <Link class="mr-2" to="oldJobs">Nos travaux passés</Link>
          <a class="mr-2" href="futureJobs">Nos travaux futurs</a>
          <a href="autre">Je sais pas quoi</a>
        </div>
      </div>
      <hr />
      <NosPis eux={pios}></NosPis>
    </div>
  )
}

export default DashboardPage;
